	async function openOffer(e){
		e.preventDefault()
		const id = offer.id
		window.href = '/offer'
	}

	if(offer == null){
		return
	}

	return (
		<div className='showcase'>
			<img src={offer.image} />
			<h1>{offer.name}</h1>
			<p>{offer.description}</p>
			<span>{offer.price}</span>
		</div>
	);
}

export default Showcase;
